define({"topics" : [{"title":"HTTP Method","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_t4k_2hh_jw","attributes": {"data-id":"concept_t4k_2hh_jw",},"menu": {"hasChildren":true,},"tocID":"concept_t4k_2hh_jw-d46e123833","next":"concept_t4k_2hh_jw-d46e123833",},{"title":"Actions for Response Statuses","shortdesc":"\n               <p class=\"shortdesc\">By default, the HTTP Client processor processes only responses that include a 2xx         success status code. When the response\n                  includes any other status code, such as a 4xx or 5xx         status code, the processor generates an error and handles the\n                  record based on the error         record handling configured for the stage.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_zpw_gl4_kmb","attributes": {"data-id":"concept_zpw_gl4_kmb",},"menu": {"hasChildren":false,},"tocID":"concept_zpw_gl4_kmb-d46e123887","topics":[]},{"title":"Parallel Requests","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor sends multiple requests at a time. To preserve record order,         the processor waits until all\n                  requests for the entire batch are completed before processing         the next batch.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_d3m_yrn_jw","attributes": {"data-id":"concept_d3m_yrn_jw",},"menu": {"hasChildren":false,},"tocID":"concept_d3m_yrn_jw-d46e123932","topics":[]},{"title":"Pagination","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_yx4_w5h_kmb","attributes": {"data-id":"concept_yx4_w5h_kmb",},"menu": {"hasChildren":true,},"tocID":"concept_yx4_w5h_kmb-d46e123987","next":"concept_yx4_w5h_kmb-d46e123987",},{"title":"OAuth 2 Authorization","shortdesc":"\n               <p class=\"shortdesc\">You can configure the HTTP Client processor to use the OAuth 2 protocol to connect to an         HTTP service that uses basic,\n                  digest, or universal authentication, OAuth 2 client         credentials, OAuth 2 username and password, or OAuth 2 JSON Web\n                  Tokens (JWT).\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_s4p_15f_5y","attributes": {"data-id":"concept_s4p_15f_5y",},"menu": {"hasChildren":true,},"tocID":"concept_s4p_15f_5y-d46e124919","next":"concept_s4p_15f_5y-d46e124919",},{"title":"Generated Output","shortdesc":"\n               <p class=\"shortdesc\"></p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_yqv_23v_bhb","attributes": {"data-id":"concept_yqv_23v_bhb",},"menu": {"hasChildren":true,},"tocID":"concept_yqv_23v_bhb-d46e125605","next":"concept_yqv_23v_bhb-d46e125605",},{"title":"Logging Request and Response Data","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor can log request and response data to the <span class=\"ph\">Data Collector</span>         log.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_dhg_gmk_hdb","attributes": {"data-id":"concept_dhg_gmk_hdb",},"menu": {"hasChildren":false,},"tocID":"concept_dhg_gmk_hdb-d46e126005","topics":[]},{"title":"Logging the Resolved Resource URL","shortdesc":"\n               <p class=\"shortdesc\">You can write the resolved resource URL to the <span class=\"ph\">Data Collector</span> log. \n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_kjb_gfz_m2b","attributes": {"data-id":"concept_kjb_gfz_m2b",},"menu": {"hasChildren":false,},"tocID":"concept_kjb_gfz_m2b-d46e126225","topics":[]},{"title":"Data Formats","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor parses each server response based on the selected data         format and writes the response to\n                  the specified output field in the selected         format.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_jrj_hmh_jw","attributes": {"data-id":"concept_jrj_hmh_jw",},"menu": {"hasChildren":false,},"tocID":"concept_jrj_hmh_jw-d46e126455","topics":[]},{"title":"Configuring HTTP Client Processor","shortdesc":"\n               <p class=\"shortdesc\">Configure an HTTP Client processor to perform requests against a resource         URL.</p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#task_z54_1qr_fw","attributes": {"data-id":"task_z54_1qr_fw",},"menu": {"hasChildren":false,},"tocID":"task_z54_1qr_fw-d46e126692","topics":[]}]});